// Countdown
$(function() {
	$('.countdown').each(function(){
		var count = $(this);
		$(this).countdown({
			zeroCallback: function(options) {
				var newDate = new Date(),
					newDate = newDate.setHours(newDate.getHours() + 130);
				
				$(count).attr("data-countdown", newDate);
				$(count).countdown({
					unixFormat : true
				});
			}
		});
	});
});

